const Dashboard = ({ user }) => {
  return (
    <div className="dashboard">
      <h2>Welcome, {user.email}</h2>
      <p>Your role: <strong>{user.role}</strong></p>

      {user.role === "Admin" && <p>You have full access.</p>}
      {user.role === "Trainer" && <p>Manage your schedule and clients.</p>}
      {user.role === "Member" && <p>View workout plans and attendance.</p>}
      {user.role === "Staff" && <p>Check attendance and manage inventory.</p>}
    </div>
  );
};

export default Dashboard;
